* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { useState } from "react";
import { Container } from "react-bootstrap";
import styles from "./index.module.css";
import Menu from "@mui/material/Menu";
import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  MenuItem,
} from "@mui/material";
import {
  BackupTable,
  ExpandMore,
  ExpandMoreOutlined,
  FiberNew,
  Help,
  Home,
  Logout,
  ManageAccounts,
  MoneyOff,
  MoneyRounded,
  Report,
  Summarize,
} from "@mui/icons-material";

const Header = () => {
  const [anchorEl, setAnchorEl] = useState(null);
  const [menu2, setMenu2] = useState(null);
  const [menu3, setMenu3] = useState(null);
  const [menu4, setMenu4] = useState(null);
  const [menu5, setMenu5] = useState(null);
  const [submenu, setsubmenu] = useState(null);
  const handleOpenMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu3 = (event) => {
    setMenu3(event.currentTarget);
  };
  const handleCloseMenu3 = () => {
    setMenu3(null);
  };

  const handleOpenMenu5 = (event) => {
    setMenu5(event.currentTarget);
  };
  const handleCloseMenu5 = () => {
    setMenu5(null);
  };
  const handleOpenMenu4 = (event) => {
    setMenu4(event.currentTarget);
  };
  const handleCloseMenu4 = () => {
    setMenu4(null);
  };
  const handleOpenMenu1 = (event) => {
    setMenu2(event.currentTarget);
  };
  const handleCloseMenu = () => {
    setAnchorEl(null);
  };
  const handleCloseMenu1 = () => {
    setMenu2(null);
  };
  const [expanded, setExpanded] = React.useState(false);
  const [expandedstock, setExpandedstock] = React.useState(false);
  const [expandedgeneral, setexpandedgeneral] = React.useState(false);
  const handleChange = (panel) => (event, isExpanded) => {
    setExpanded(isExpanded ? panel : false);
  };
  const handleChange2 = (panel) => (event, isExpanded) => {
    setExpandedstock(isExpanded ? panel : false);
  };
  const handleChange3 = (panel) => (event, isExpanded) => {
    setexpandedgeneral(isExpanded ? panel : false);
  };
  return (
    <footer className={styles.footer}>
      <Container fluid>
        <ul className={styles.footermenu}>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <Home
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Home</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu1"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <ManageAccounts
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Master</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu2"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu1}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <MoneyOff
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />
              <span>Transaction</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu3"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu3}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <FiberNew
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Namu</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu4"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu4}
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <Summarize
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />
              <span> Report</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu5"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu5}
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <BackupTable
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Utility</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <Help
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <spam>Help</spam>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <Logout
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Out</span>
            </a>
          </li>
        </ul>
        <Menu
          id="hover-menu1"
          anchorEl={anchorEl}
          keepMounted
          open={Boolean(anchorEl)}
          onClose={handleCloseMenu}
          onMouseLeave={handleCloseMenu}
        >
          <div style={{ display: "flex" }}>
            <div>
              {" "}
              <Accordion
                keepMounted
                className={styles.hovermenu}
                style={{
                  "&:hover": {
                    backgroundColor: "#fff",
                  },
                  border: "none",
                  boxShadow: "none",
                }}
                expanded={expanded === "panel1"}
                onChange={handleChange("panel1")}
              >
                <AccordionSummary
                  expandIcon={<ExpandMoreOutlined />}
                  aria-controls="panel1bh-content"
                  id="panel1bh-header"
                >
                  Assembly
                </AccordionSummary>
                <AccordionDetails>Sabhasad Registration</AccordionDetails>
                <AccordionDetails>Sabhasad land entry</AccordionDetails>
                <AccordionDetails>Entry of Sabhasad shares</AccordionDetails>
                <AccordionDetails>
                  Entrance to the Assembly Hall
                </AccordionDetails>
                <AccordionDetails>
                  Entry of Sabhasad vehicles/machines
                </AccordionDetails>
                <AccordionDetails>Entry of Sabhasad Varasdar</AccordionDetails>
                <AccordionDetails>Sabhasad photo upload</AccordionDetails>
              </Accordion>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                My Community Entry
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                Employee Entry
              </MenuItem>
              <Accordion
                keepMounted
                className={styles.hovermenu}
                style={{
                  border: "none",
                  boxShadow: "none",
                }}
                expanded={expandedstock === "panel1"}
                onChange={handleChange2("panel1")}
              >
                <AccordionSummary
                  className={styles.hovermenu}
                  expandIcon={<ExpandMoreOutlined />}
                  aria-controls="panel1bh-content"
                  id="panel1bh-header"
                >
                  Dead stock
                </AccordionSummary>
                <AccordionDetails className={styles.hovermenu}>
                  Entry of dead stock
                </AccordionDetails>
                <AccordionDetails className={styles.hovermenu}>
                  Dead stock cancellation entry
                </AccordionDetails>
              </Accordion>
              <Accordion
                keepMounted
                className={styles.hovermenu}
                style={{
                  "&:hover": {
                    backgroundColor: "#fff",
                  },
                  border: "none",
                  boxShadow: "none",
                }}
                expanded={expandedgeneral === "panel1"}
                onChange={handleChange3("panel1")}
              >
                <AccordionSummary
                  expandIcon={<ExpandMoreOutlined />}
                  aria-controls="panel1bh-content"
                  id="panel1bh-header"
                >
                  General Ledger Master
                </AccordionSummary>
                <AccordionDetails> General Ledger Master </AccordionDetails>
                <AccordionDetails>Create a new group</AccordionDetails>
                <AccordionDetails>Create a new head Opening</AccordionDetails>
                <AccordionDetails>
                  Opening of New Account - In G.L
                </AccordionDetails>
                <AccordionDetails>
                  Opening of New Account - In GL-2
                </AccordionDetails>
              </Accordion>
            </div>

            <div>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                Crop Master
              </MenuItem>
              Cash-transactions Transfer transaction f
              <Accordion
                keepMounted
                className={styles.hovermenu}
                style={{
                  "&:hover": {
                    backgroundColor: "#fff",
                  },
                  border: "none",
                  boxShadow: "none",
                }}
                expanded={expandedgeneral === "panel1"}
                onChange={handleChange3("panel1")}
              >
                <AccordionSummary
                  expandIcon={<ExpandMoreOutlined />}
                  aria-controls="panel1bh-content"
                  id="panel1bh-header"
                >
                  Lending Master
                </AccordionSummary>
                <AccordionDetails> General Ledger Master </AccordionDetails>
                <AccordionDetails>Create a new group</AccordionDetails>
                <AccordionDetails>Create a new head Opening</AccordionDetails>
                <AccordionDetails>
                  Opening of New Account - In G.L
                </AccordionDetails>
                <AccordionDetails>
                  Opening of New Account - In GL-2
                </AccordionDetails>
              </Accordion>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                Lending Interest Master
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                {" "}
                Master the deposit Interest
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                Thing Master
              </MenuItem>
            </div>
          </div>
        </Menu>
        <Menu
          id="hover-menu2"
          anchorEl={menu2}
          keepMounted
          open={Boolean(menu2)}
          onClose={handleCloseMenu1}
          onMouseLeave={handleCloseMenu}
        >
          <div style={{ display: "flex" }}>
            <div>
              {" "}
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu1}>
                Lending
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu1}>
                Recovery
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu1}>
                Purchase
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu1}>
                Sale
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu1}>
                Credit Sheet
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu1}>
                KCC Charge
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu1}>
                Insurance premium generation
              </MenuItem>
            </div>
          </div>
        </Menu>
        <Menu
          id="hover-menu3"
          anchorEl={menu3}
          keepMounted
          open={Boolean(menu3)}
          onClose={handleCloseMenu3}
          onMouseLeave={handleCloseMenu3}
        >
          <div style={{ display: "flex" }}>
            <div>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu3}>
                Open a new Account
              </MenuItem>
            </div>
          </div>
        </Menu>
        {/* <p className="copyright text-center">
               {new Date().getFullYear()}{" "}
              <a href="http://www.creative-tim.com">Creative Tim</a>, made with
              love for a better web
            </p> */}
        <Menu
          id="hover-menu4"
          anchorEl={menu4}
          keepMounted
          open={Boolean(menu4)}
          onClose={handleCloseMenu4}
          onMouseLeave={handleCloseMenu4}
        >
          <div style={{ display: "flex" }}>
            <div>
              {" "}
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu4}>
                Sabhasad-Report
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu4}>
                Account-Report
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu4}>
                Lending/Collection-Report
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu4}>
                MIS-Report
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu4}>
                Bank-Report
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu4}>
                Other-report
              </MenuItem>
            </div>
          </div>
        </Menu>
        <Menu
          id="hover-menu5"
          anchorEl={menu5}
          keepMounted
          open={Boolean(menu5)}
          onClose={handleCloseMenu5}
          onMouseLeave={handleCloseMenu5}
        >
          <div style={{ display: "flex" }}>
            <div>
              {" "}
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu5}>
                Backing Up data
              </MenuItem>
            </div>
          </div>
        </Menu>
        \
      </Container>
    </footer>
  );
};

export default Header;
